import './leftSide.css'
import { NavLink } from "react-router-dom";
import { useState} from 'react';

// console.log()
const LeftSide = () => {
    const [HomeNav_BackgroundColor, setHomeNav_BackgroundColor] = useState('initialState');
    const [CashBookNav_BackgroundColor, setCashBookNav_BackgroundColor] = useState(initialState);
    const [EnventoryNav_BackgroundColor, setEnventoryNav_BackgroundColor] = useState(initialState);
    const [KeepSafeNav_BackgroundColor, setKeepSafeNav_BackgroundColor] = useState(initialState);
    return (
        <span id='leftSpan' className='desktop'>
            <div id='leftSpan_Overlay'>
                <NavLink style={
                    ({ isActive }) => {
                        console.log(isActive)
                        return {
                            backgroundColor: isActive ? "var(--color5)" : "var(--color5)",
                            color: isActive ? "var(--color5)" : "var(--color2)",
                        };
                    }} 
                    className="NavLink" to="/home"
                >
                    <div className='leftNav_selected home'>
                        <div id='leftNav_home'></div>
                        <p>Home</p>
                    </div>
                </NavLink>

                <NavLink className="NavLink" to="/ledger">
                    <div className='leftNav_selected cashbook'>
                        <div id='leftNav_cashbook'></div>
                        <p>Cashbook</p>
                    </div>
                </NavLink>

                <NavLink className="NavLink" to="/enventory">
                    <div className='leftNav_selected enventory'>
                        <div id='leftNav_enventory'></div>
                        <p>Enventory</p>
                    </div>
                </NavLink>

                <NavLink className="NavLink" to="/keepSafe">
                    <div className='leftNav_selected keepsafe'>
                        <div id='leftNav_keepsafe'></div>
                        <p>Keep safe</p>
                    </div>
                </NavLink>
            </div>
        </span>
    );
}

export default LeftSide;
